import React from "react";
import GoogleMapReact from 'google-map-react';
const AnyReactComponent = ({ text }) => <div>{text}</div>;

const MapView = ({ data }) => {
    return (
      <div className="row">

        {data.map((row, i)=>(
             <div className="col s12 m3 l6 card horizontal box" key={i}>
               <p> {row.location.longitude}</p> 
               <p>  {row.location.latitude}</p> 

          <div style={{ height: '100vh', width: '100%' }}>
        <GoogleMapReact
          bootstrapURLKeys={{ key: 'AIzaSyDRCcfJVtzzqsrmB5NpU2pytpTEjNlUDUk&libraries' }}
          defaultCenter={this.props.center}
          defaultZoom={this.props.zoom}
        >
          <AnyReactComponent
            lat={row.location.longitude}
            lng={row.location.latitude}
            text="My Marker"
          />
        </GoogleMapReact>
      </div>
             </div>

          ))} 


      </div>
    );
  };

  export default MapView;
